description:
Jay responds to an employment ad seeking a new office assistant that he is perfectly qualified for. In order to take his application to the next step he must be put through several tests as mentioned by the current Office Managers. Miss Gigi and Alura trick their clueless applicant into thinking he is taking a &quot;Lie Detecting&quot; Test with a device placed over his head. What he doesn't know is he is about to go under a total transformation process turning him into a mindless shell of a bitch making him completely susceptible to any commands given. Miss Gigi and Alura see just how far they can control their new office drone using him as just a piece of entertainment to cure their office boredom. 

